import React from 'react'; 
import "./App.css";

function App() {
    const sayHello = () => {
        console.log("hello");

    }

    

    return (
        <div className="App">
         
 
            <h1>
                Hello Gabi 
                </h1>
            <p> can you do me a solid and please don't drop the: </p>
            
            <button onClick={sayHello}> Hello</button>
            
    
        </div>
        )
}
export default App;
